import { AppBar, Toolbar, IconButton, styled } from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";

const Header = styled(AppBar)`
  background: black;
`;
const Tab = styled("p")`
  font-size: 20px;
  margin-right: 25px;
`;

const NavBar = () => {
  return (
    <Header>
      <Toolbar>
        <Tab>
          <b>Student Management</b>
        </Tab>
        <Tab>All Users</Tab>
        <Tab>Add User</Tab>
      </Toolbar>
    </Header>
  );
};

export default NavBar;
